import React from 'react';

import './Navbar.css';
// import Navbar from 'react-bootstrap/Navbar';

const Navbar = () => {
    return (
        <div>
            <div class="topnav">
                <a class="active" href="#home">Home</a>
                <a href="#work">My Work</a>
                <a href="#contact">Contact Me</a>
                <a href="#about">About</a>
            </div>
        </div>
    );
};

export default Navbar;
